import Banner from '../../components/Banner'
import styled from 'styled-components'

const HomeContainer = styled.div`
  widht: 100vw;
  max-width: 1240px;
  height: 23vh;
  max-height: 223px;
`

function Home() {
  return (
    <HomeContainer>
      <Banner />
    </HomeContainer>
  )
}

export default Home
